import React, { Component } from 'react'

 class ClassMouse extends Component {
     constructor(props) {
         super(props)
     
         this.state = {
              x:0,
              y:0
         }
     }
     
    render() {
        const{x,y}=this.state
        return (
            <div>
                PosX--{x},   PosY--{y}
            </div>
        )
    }
}

export default ClassMouse
